import React from 'react';
import CardList from './CardList';
import EvolutionChain from './EvolutionChain';

const PokemonLists = (props) => {
    if (props.displayEvolution) {
        return <EvolutionChain pokemonList={props.pokemonList} onMouseClick={props.onMouseClick}/>
    }
    return <CardList pokemonLis={props.pokemonList} onMouseClick={props.onMouseClick}/>
}

export default PokemonLists;
